pr_body:
### Description
<!-- Provide a brief description of the changes in this pull request -->

1. Notification Permissions functionality of permission_handler plugin was not setup properly, so it was not asking for permissions and directly causing an error, which results in not Navigating back to the home screen.
2. Both the systemAlertWindow & ignoreBatteryOptimization are Android only.

### Proposed Changes
<!-- List the proposed changes introduced by this pull request -->
1. Updated info.plist for Notification permissions Group:
```
<key>PermissionGroupNotification</key>
<string>This app needs notification permissions to show notifications.</string>
```
2. Updated Podfile for asking Notification permissions using [these instruction](https://github.com/Baseflow/flutter-permission-handler/issues/1114#issuecomment-1649425295) given in one of the similar issues in the official github repo for permissions_handler plugin:
```
    target.build_configurations.each do |config|
      # You can remove unused permissions here
      # for more infomation: https://github.com/BaseflowIT/flutter-permission-handler/blob/master/permission_handler/ios/Classes/PermissionHandlerEnums.h
      # e.g. when you don't need camera permission, just add 'PERMISSION_CAMERA=0'
      config.build_settings['GCC_PREPROCESSOR_DEFINITIONS'] ||= [
        '$(inherited)',
        
        ## dart: PermissionGroup.notification
        'PERMISSION_NOTIFICATIONS=1',
      ]
    end
```
3. Added Platform check for android only permissions in add_or_update_alarm_controller.dart:
```
              if (Platform.isAndroid) {
                // Request overlay permission
                if (!(await Permission.systemAlertWindow.isGranted)) {
                  final status = await Permission.systemAlertWindow.request();
                  if (!status.isGranted) {
                    debugPrint('SYSTEM_ALERT_WINDOW permission denied!');
                    return;
                  }
                }

                if (!(await Permission.ignoreBatteryOptimizations.isGranted)) {
                  bool requested = await Permission.ignoreBatteryOptimizations
                      .request()
                      .isGranted;
                  if (!requested) {
                    debugPrint(
                        'IGNORE_BATTERY_OPTIMIZATION permission denied!');
                    return;
                  }
                }
              }
```

## Fixes both #497 & #498 

